import React from 'react';

import './MainPageStyle.css';
import {C_button} from '../core/Components';
import { MdPerson, MdSearch, MdApps } from 'react-icons/md';


export class MainPage extends React.Component {
    constructor(props) {
        super(props);

    }

    render(){
        
        return(
            <div id="container">
    
                <header className="header blur">
                    <div><MdApps fontSize="30px"/></div>
    
                    {/* <div className="containerSearch">
                        <input placeholder="Pesquisar " className="searchBtn" type="text" />
                        <MdSearch className="searchIcon"/>
                    </div> */}
    
                    <div><MdSearch color="white" fontSize="30px"/></div>
                </header>
    
                <body className="body">
                    <div className="containerOptions blur">
                        <div className="option">
                            <MdPerson/>
                        </div>
                        {/* <div className="option">
                            <BsTools className="toolIcon"/>
                        </div>
                        <div className="option">
                            <MdInsertChart/>
                        </div> */}
                    </div>
                </body>
    
              
            </div>
        );
    };
}
